import React, {Component} from 'react'

class UpdatePost extends Component {
    constructor(props){
        super(props)
        this.state = {
          tab: this.props.tab
        };
    }


    render() {
        return (
            <div>
                {
                    this.state.tab
                }
            </div>
        )
    }

}
